import {useState, useEffect} from 'react'
import axios from "axios"

const List = (props) => {
    // useEffect(() => {
    //     alert("Success");
    // })

    useEffect(() => {
        axios
        .post('/api/test')
        .then((response) =>{
            console.log(response.data);

        })
        .catch((error) => {
            console.log(error);

    });
    }, [])

    return (
        <div>
            <h1>
                List!
            </h1>
      {props.ContentList.map((content,idx) => {return <div key={idx}>{content}</div>;
      })}

    </div>
    );
};

export default List;
